text:
@_LOVELYSPAIN_ @archi_tradition I've spent month in València on my Erasmus.
Absolutely loved it!
Can't wait to visit this charming city again sometime! ❤️

@GerdaJenda @EmSiiKakao @PemyslP1 @iprpraha @jirijaros @spolekautomat @Adam_Scheinherr Myslím, že by jednoduchým řešením bylo postavení dobrých, propojených cyklostezek.
Snažím se jezdit po cyklostezkách, ale v Plzni jsou naprd, takže někdy musím po silnici.
V základních značkám se význam, ale řidičák nemám, takže někdy nevím jestli mám přednost já nebo někdo jiný.

@BrendenBourne @MegaLoScani @VicctorianChad Don't know about you, but brutalism can be quite cool if you ask me.
Especially Czechoslovak brutalism.

But unfortunately it sometimes is too costly to maintain so it remains in poor condition (example of Slovenský rozhlas in Bratislava on the last pic). https://t.co/kRlBWxhyO2

@OzuchMichal @feather_cover @Sady1993 @tkapler Tohle jsem našel na ofiko stránkách, co jsi hodil do jinýho tweetu.

Ještě nějaké další argumenty k tomu, že jde čistě o soutěž krásy?

Není to chlap, ale holka, svoji transfobnost si nech pro sebe. https://t.co/KBklqmPNGs
